import React from 'react';
import './App.css';



const App = () => {
  return (
    <div className='app-wrapper'>

      <nav className='nav'>
        <div>
         <a href="">Главная</a> 
          </div>
        <div>
        <a href="">Авторизация</a> 
          </div>
        <div>
        <a href="">Профиль</a> 
          </div>
        <div>
        <a href="">Информация</a> 
          </div>
      </nav>
      <div className='content'>
       <img src="https://bitnovosti.com/wp-content/uploads/2018/03/Franc.jpg"></img>
        </div>
    </div>
  );
}

export default App;
